import React from "react";
import {  } from "react-bootstrap";
import { NavLink } from 'react-router-dom';

const Header = () => {
    return <nav class="navbar navbar-expand-lg navbar-light bg-light">
    <NavLink to="/home" class="navbar-brand" > Картинг центр </NavLink>
    <NavLink to="/cont" class="nav-link" > Контакты </NavLink>
    <NavLink to="/serv" class="nav-link" > Услуги </NavLink>
    <NavLink to="/s" class="nav-link" > Личный кабинет </NavLink>
  </nav>
}

export default Header;
